import React from "react";
import Pagination from "@mui/material/Pagination";
import Stack from "@mui/material/Stack";
import "./style.css";

export default function BasicPagination({ postsPerPage, totalPosts }) {
  return (
    <div className="pagination">
      <Stack spacing={2}>
        <Pagination count={10} />
      </Stack>
    </div>
  );
}
